import React, { useEffect } from "react";
import { Grid } from "semantic-ui-react";
import DefaultUser from "./cards/defaultUser";
import CustomUserCard from "./cards/customUser";
import UserForm from "./cards/customUser";
import { connect } from "http2";
import { UserElement } from "../assets/propTypes";

const Landing = (props: UserElement) => {
  return (
    <React.Fragment>
      <div style={{ margin: "0px 15%" }}>
        <Grid columns={2} divided stackable>
          <Grid.Column>
            <CustomUserCard />
          </Grid.Column>
          <Grid.Column>
            <UserForm {...props} />
          </Grid.Column>
        </Grid>
      </div>
    </React.Fragment>
  );
};

